import { Container, Stack, Typography, Button, Icon } from '@mui/material';
import Page from '../components/Page';
//

interface food {
  name: string;
  calories: number;
  fat: number;
  carbs: number;
  protein: number;
}

const useStyles = makeStyles({
  table: {
    minWidth: 650
  }
});

const originalRows: food[] = [
  { name: "Pizza", calories: 200, fat: 6.0, carbs: 24, protein: 4.0 },
  { name: "Hot Dog", calories: 300, fat: 6.0, carbs: 24, protein: 4.0 },
  { name: "Burger", calories: 400, fat: 6.0, carbs: 24, protein: 4.0 },
  { name: "Hamburger", calories: 500, fat: 6.0, carbs: 24, protein: 4.0 },
  { name: "Fries", calories: 600, fat: 6.0, carbs: 24, protein: 4.0 },
  { name: "Ice Cream", calories: 700, fat: 6.0, carbs: 24, protein: 4.0 }
];

export default function Items() {





  return (
    <Page title="ITEMS - BIZHOPS">
      <Container>
        <Typography variant="h4">All Items</Typography>
        All products or service you offer!
      </Container>
    </Page>
  );
}
